import java.math.BigInteger;


public class ModPow {

	public static void main(String [] args){
		BigInteger c = new BigInteger("");
		BigInteger d = new BigInteger("");
		BigInteger n = new BigInteger("");
		String s = c.modPow(d, n).toString(10);
		System.out.println(s);
		for(int i = s.length()-1; i >= 0; i-=2){
			int x1 = Integer.parseInt(s.substring(i-1, i+1));
			if(x1 > 26){
				x1 = Integer.parseInt(s.substring(i, i+1));
				i++;
			}
			System.out.print(getVal(x1));
		}
	}
	static char getVal(int a){
		return (char) (a+'a');
	}
}
